import React from "react";
import ArrowBackIcon from '@material-ui/icons/ArrowBack';


function BackButton() {
  return <button className='backButton'><span className='backButton_arrow'><ArrowBackIcon fontSize="large" /></span>Back</button>;
}

export default BackButton;
